      }
 ];
const columns = [{
  dataField: 'id',
  text: 'Product ID'
}, {
  dataField: 'name',
  text: 'Product Name'
}, {
  dataField: 'price',
  text: 'Product Price'
}];

function home() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-12 text-center">
          <h1>hello world</h1>
          <BootstrapTable keyField="id" data={products} columns={columns} />
        </div>
      </div>
    </div>
  );
}

export default home;
